El castillo de Corfe es una fortificación que se encuentra sobre el pueblo del mismo nombre en el condado inglés de Dorset. Construido por Guillermo el Conquistador, el castillo data del siglo XI. Fue uno de los primeros castillos de Inglaterra que se construyó, al menos en parte, con piedra, cuando la mayoría se construyó con tierra y madera. El castillo de Corfe sufrió importantes cambios estructurales en los siglos XII y XIII.

En 1572, el castillo de Corfe dejó el control de la Corona cuando Isabel se lo vendió a Sir Christopher Hatton. Sir John Bankes compró el castillo en 1635 y fue propietario durante la Guerra Civil Inglesa. Su esposa, Lady Mary Bankes, dirigió la defensa del castillo cuando fue asediado dos veces por fuerzas parlamentarias. El primer asedio, en 1643, no tuvo éxito, pero en 1645 Corfe era una de las últimas fortalezas realistas que quedaban en el sur de Inglaterra y cayó en un asedio que terminó en un asalto. Propiedad del National Trust, el castillo está abierto al público y en 2018 recibió alrededor de 237,000 visitantes. 

